import React,{useState} from 'react';
import reactdom from 'react-dom';

const App=()=>{
    return (
        <div>
        <header>
        <nav className="navbar">
            <ul>
                <li className="nav-item">Home</li>
                <li className="nav-item">Chat</li>
            </ul>
        </nav>
        </header>
        </div>
    );
}


reactdom.render(<App/>,document.querySelector("#root"));
